    _compile_error = None
except Exception as e:
    _compile_error = e

def wrapper(SepalLength, SepalWidth, PetalLength, PetalWidth):
    "Output: var1, msg"
    result = None
    try:
        global _compile_error
        if _compile_error is not None:
            raise _compile_error
        msg = ""
        import numpy as np
