        if result.size == 1:
            result = np.asscalar(result)
    except Exception as e:
        msg = str(e)
        if result is None:
            result = tuple(None for i in range(1))
    if isinstance(result, tuple):
        return tuple(x for x in list(result) + [msg])
    else: 
        return result, msg
